import React from "react";
import "./styles/menuv2.css";
import cards from "../media/cardss.png";

const MenuV2 = () => {
  return (
    <>
      <div className="container-menus">
        <div className="menu-option one">ex1</div>
        <img src={cards} alt="" />
        <div className="menu-option two"></div>
        <div className="menu-option three">ex3</div>
      </div>
    </>
  );
};

export default MenuV2;
